type Canvas = {
  canvRef: any;
  zindex: number;
  loc: {
    xmax: object;
    xmin: object;
    ymax: object;
    ymin: object;
  };
};

const CanvasComponent: React.FC<Canvas> = ({ canvRef, zindex, loc }) => {
  return (
    <canvas
      ref={canvRef}
      style={{
        position: "absolute",
        marginLeft: "auto",
        marginRight: "auto",
        left: 0,
        right: 0,
        width: 640,
        height: 480,
        zIndex: zindex,
      }}
    />
  );
};

export default CanvasComponent;
